function Admin() {
    const [names, setNames] = useState([
        {
            name:"Amit Vikram",
            email:"amit@test.com"
        },
        {
            name:"John George",
            email:"amit@targiver.com"
        },
        {
            name:"Augustine Daug",
            email:"aug@test.com"
        },
        {
            name:"Ashu Lwkhi",
            email:"ashu@test.com"
        },
        {
            name:"Darth Vader",
            email:"osssd@test.com"
        },
    ]);
    const getTypedName = (e) => {
        return e.target.value;
    }
    return (
        <div className="searchable-table">
            <div className="row">
                <div className="form-group">
                    <input 
                    type="text" 
                    name="username" 
                    id="user" 
                    placeholder="Type username here"
                    onChange={getTypedName}
                    />
                </div>
            </div>
            <div className="row">
                <table className="table">
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Email</th>
                        </tr>
                    </thead>
                    <tbody>

                    </tbody>
                </table>
            </div>  
        </div>
    )
}

export default Admin;
